// State classes
class CashierState {
  final AsyncValue<List<Order>> orders;
  final Order? selectedOrder;
  final double cashTendered;
  final bool isProcessing;
  final String? error;
  final String selectedPaymentMethod;

  CashierState({
    required this.orders,
    this.selectedOrder,
    this.cashTendered = 0,
    this.isProcessing = false,
    this.error,
    this.selectedPaymentMethod = 'cash',
  });

  CashierState copyWith({
    AsyncValue<List<Order>>? orders,
    Order? selectedOrder,
    double? cashTendered,
    bool? isProcessing,
    String? error,
    String? selectedPaymentMethod,
  }) {
    return CashierState(
      orders: orders ?? this.orders,
      selectedOrder: selectedOrder ?? this.selectedOrder,
      cashTendered: cashTendered ?? this.cashTendered,
      isProcessing: isProcessing ?? this.isProcessing,
      error: error, // Nullable update
      selectedPaymentMethod: selectedPaymentMethod ?? this.selectedPaymentMethod,
    );
  }

  double get change =>
      selectedOrder != null ? cashTendered - selectedOrder!.totalPrice : 0;

  bool get canProcess =>
      selectedOrder != null &&
      cashTendered >= selectedOrder!.totalPrice &&
      !isProcessing;
